  useEffect(() => {
    const account = props.account;

  },[props])





  return (
    <div>
      <a className="twitter-timeline"
        href={"https://twitter.com/" + account}>
        Tweets by @{account}
      </a>
    </div>


  );
};

export default TwitterComponent;
